import React from 'react'

const CTA = () => {
    return (
        <div className='text-center max-w-max text-black text-base font-bold p-3 rounded-full px-5 bg-white'>Invest Now</div>
    )
}

const Hero = () => {
    return (
    <div className='flex flex-col h-screen justify-evenly items-center text-center text-white bg-black p-10 bg-gradient-to-tl from-black via-black to-gray-900'>
        <div className='font-extrabold text-3xl'>FOR THE NEW GENERATION OF SPORTS.</div>
        <CTA />
    </div>
    )
}

const Tokenomics = () => { 
    return (
    <div className='flex flex-col text-black bg-white p-10 space-y-8'>
        <div className='font-extrabold text-3xl'>Our purpose.</div>
        <div className='font-normal text-base leading-snug space-y-6'>
            <div>The way we watch sports is changing and <b>STAGELINK</b> is designed to handle this.</div>
            <div>Built using the robust and secure BSC network, <b>STAGELINK</b> aims to disrupt the authoritative and bureaucratic PPV model and replace it with a decentralised and fairly priced alternative.</div>
        </div>
        <div className='flex flex-col ring-1 ring-gray-800 p-10 bg-white rounded'>

        </div>
    </div>
    )
}

const Home = () => {
    return (
        <div>
            <Hero />
            <Tokenomics />
        </div>
    )
}

export default Home
